import './menu.scss';
import React from 'react';
import {Link} from "react-router-dom";

function Menu() {
    return (
        <div className="menu">
            <div className="menu_inner">
                <ul>
                    <li className="main_inner"><Link to="/">LET'S TRIP</Link></li>
                    <li><Link to="/map">숙소 검색</Link></li>
                    <li><Link to="/input">좌표 입력</Link></li>
                </ul>            
            </div>
        </div>
    );
}

export default Menu;
